public class SurveyReplyTest {

    @Test
    public void testPrePersist_WhenCalled_ShouldSetCreatedAtAndLastModified() {
        // Arrange
        SurveyReply surveyReply = new SurveyReply();

        // Act
        surveyReply.prePersist();

        // Assert
        Date currentDate = new Date();
        assertEquals(currentDate, surveyReply.getCreatedAt(), "CreatedAt should be set to current date");
        assertEquals(currentDate, surveyReply.getLastModified(), "LastModified should be set to current date");
    }
}
```

Please note that I have assumed the class `SurveyReply` has getter methods `getCreatedAt()` and `getLastModified()` to retrieve the values of `createdAt` and `lastModified` respectively, as the original class snippet you provided didn't include them. The test method ensures that when `prePersist()` is called, the `createdAt` and `lastModified` fields are set to the current date, and then it checks if they were set correctly using `assertEquals`.
